package java1;

public class ForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=1;
		//char c='a';    replace c by  int a
		for(int i=1; i<5; i++) 
		{		
			for(int j=1; j<5; j++) {
				
			System.out.print(" "+a);
			a++;
			}
			
			System.out.println("\n");
		}
		

	}

}
